const Products= () => {

    return (
       <section>
            <h1>The Products Page</h1>
            <ul>
                <li><Link to='/products/p1'>A Book</Link></li>
                <li>Carpet</li>
                <li>An Online Course</li>
                <li>Table</li>
            </ul>
       </section>
    );
};

export default Products;
